import React from 'react';

const Contact = ({id}) => {
    return(
            <div className = 'vh-100 w-75 center mt5' id = {id}>
            <div className = 'bb w-50 center border-height'>
                <h1 className = 'tc'>Contact</h1>
            </div>
            <footer className = 'pt2'>Made By Colton Williams</footer>
            </div>
 );
}

export default Contact;
